// src/pages/History.js
import React, { useEffect, useState } from 'react';
import styled from 'styled-components';
import { ref, onValue } from 'firebase/database';
import { database } from '../firebase';

const Wrap = styled.div``;
const Card = styled.div`
  background: rgba(255,255,255,0.03);
  border-radius: 12px;
  padding: 18px;
  margin-bottom: 12px;
  box-shadow: 0 12px 30px rgba(2,6,23,0.28);
  border: 1px solid rgba(255,255,255,0.03);
  display:flex;
  justify-content:space-between;
  align-items:center;
`;

export default function History() {
  const [items, setItems] = useState([]);

  useEffect(() => {
    const r = ref(database, 'readings');
    const unsub = onValue(r, snapshot => {
      const v = snapshot.val();
      if (!v) {
        setItems([]);
        return;
      }
      const arr = Object.entries(v).map(([id,val])=>({ id, ...val }));
      arr.sort((a,b)=> new Date(b.timestamp) - new Date(a.timestamp));
      setItems(arr);
    });

    return () => unsub();
  }, []);

  return (
    <Wrap>
      <h1>Historical Readings</h1>

      <div style={{ display:'flex', justifyContent:'flex-end', marginBottom: 12 }}>
        <select style={{ padding:8, borderRadius:8 }}>
          <option>All Sources</option>
        </select>
      </div>

      {items.length === 0 && <div style={{ color:'rgba(255,255,255,0.7)' }}>No history yet.</div>}

      {items.map(it => (
        <Card key={it.id}>
          <div>
            <div style={{ fontWeight:900 }}>{it.source || 'unknown'}</div>
            <div style={{ color:'rgba(255,255,255,0.6)', marginBottom:8 }}>{new Date(it.timestamp).toLocaleString()}</div>

            <div style={{ display:'grid', gridTemplateColumns:'repeat(5, auto)', gap:18 }}>
              <div><div style={{ fontSize:12, color:'rgba(255,255,255,0.6)' }}>Temp</div><div style={{ fontWeight:800 }}>{Number(it.temperature || 0).toFixed(2)} Â°C</div></div>
              <div><div style={{ fontSize:12, color:'rgba(255,255,255,0.6)' }}>TDS</div><div style={{ fontWeight:800 }}>{Number(it.tds || 0).toFixed(2)} ppm</div></div>
              <div><div style={{ fontSize:12, color:'rgba(255,255,255,0.6)' }}>Turbidity</div><div style={{ fontWeight:800 }}>{Number(it.turbidity || 0).toFixed(2)} NTU</div></div>
              <div><div style={{ fontSize:12, color:'rgba(255,255,255,0.6)' }}>Dissolved O2</div><div style={{ fontWeight:800 }}>{Number(it.dissolvedOxygen || 0).toFixed(2)} mg/L</div></div>
              <div><div style={{ fontSize:12, color:'rgba(255,255,255,0.6)' }}>pH</div><div style={{ fontWeight:800 }}>{Number(it.pH || 7).toFixed(2)}</div></div>
            </div>
          </div>

          <div style={{ display:'flex', gap:10, alignItems:'center' }}>
            <div style={{ background: '#10b981', color:'white', padding:'8px 12px', borderRadius:999, fontWeight:800 }}>{it.pollutionLabel || 'Unknown'}</div>
            <button style={{ background:'#ef4444', color:'white', padding:'8px 12px', borderRadius:8, border:'none' }}>Delete</button>
          </div>
        </Card>
      ))}
    </Wrap>
  );
}
